import { useContext, useState } from 'react'
import { IBrandDto } from '../../../Api/dto/IBrand'
import GlobalContext from '../../../Context/GlobalContext'
import BrandsContext from '../../../Context/BrandsContext'
import ControlPanel from './panel-controlPanel/ControlPanel'
import OutputPanel from './panel-outputPanel/OutputPanel'
import styles from './Panel.module.scss'

export default function Panel() {
    const value = useContext(GlobalContext)
    let style = {}
    style = value.isBlocked ? { width: '92%' } : { width: '100%' }

    const defaultSate: IBrandDto[] = []
    const [brans, setBrands] = useState(defaultSate)
    const [newBrands, setNewBrands] = useState(defaultSate)
    const valueStore = {
        changeStore: {
            setNewBrands: (newBrans: IBrandDto[]) => setNewBrands(newBrans),
            setBrands: (newBrans: IBrandDto[]) => setBrands(newBrans),
        },
        store: {
            newBrands: newBrands,
            brands: brans
        }
    }

    return (
        <div className={styles['workingSpace-panel']}
            style={style}
        >
            <BrandsContext.Provider value={valueStore}>
                <ControlPanel></ControlPanel>
                <OutputPanel></OutputPanel>
            </BrandsContext.Provider>
        </div>
    )
}
